import * as React from 'react';
import image1 from '../../assets/img/app_design/Group 1284@3x.png';
import image2 from '../../assets/img/app_design/Group 1285@3x.png';
import image3 from '../../assets/img/app_design/Group 1286@3x.png';
import image4 from '../../assets/img/app_design/Group 1287@3x.png';
import { List, ListItem, ListSubheader } from '@mui/material';
import { ImageList,ImageListItem, ImageListItemBar } from '@mui/material';


const app_design = () => {
  return (
    <ImageList sx={{ width: 500, height: 450 }}>
  
      {itemData.map((item) => (
        <ImageListItem key={item.img}>
          <img
            src={`${item.img}?w=248&fit=crop&auto=format`}
            srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar style={{color:"primary"}}
            title={item.title}
            subtitle={item.author}
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

const itemData = [
  {
    img: {image1},
    title: 'At HashGate, we always push the limits in IT solutions. We specialize in multiple services from Cross-platform development, Mobile Application Development, Web Development, UI-UX Design, Branding, Media, production, and many more.',
    author: '12345',
    rows: 4,
    cols: 2,
    featured: true,
  },
 
 
]

export default app_design;
